import React from 'react';
import logo from '../logo.svg';
import { BrowserRouter, Route, Switch, Link } from 'react-router-dom'

class App extends React.Component {
  constructor(props) {
    super(props)
    this.state = {name: props.name}
  }

  render() {
    return (
      <Router>
        <div>
          <nav>
            <ul>
              <li>
                <Link to="/class">Class</Link>
              </li>
            </ul>
          </nav>
        </div>
      </Router>
    );
  }
}

export default App;
